import logo from './logo.svg';
import './App.css';
import {Mainchara} from'./Mainchara';
import { Introduce } from './introduce';
function App() {
  const apple = Mainchara(`apple`,'ball','red')  
  const orange = Mainchara('orange','ball','orange')
  const banana = Mainchara('banana','curve','yellow')

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{Introduce('apple')}</p>

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
